<html>
<head>
<meta charset="utf-8">
<meta http-equiv="X-UA-Compatible" content="IE=edge" />
<style type="text/css">
* {
  font-family: 'Lato', 'Helvetica Neue', Arial, Helvetica, sans-serif;
}

.axis path,
.axis line {
fill: none;
  stroke: black;
  shape-rendering: crispEdges;
}

.axis text {
  font-size: 10px;
}

div#timeline g text {
  font-size: 13px;
}

text.timeline-label {
  font-size: 13px;
}

#timeline2 .axis {
  transform: translate(0px,30px);
  -ms-transform: translate(0px,30px); /* IE 9 */
  -webkit-transform: translate(0px,30px); /* Safari and Chrome */
  -o-transform: translate(0px,30px); /* Opera */
  -moz-transform: translate(0px,30px); /* Firefox */
}

.coloredDiv {
  height:20px; width:20px; float:left;
}

#footer {
  padding-top: 3em; color: #bfbfbf; font-size: 13px;
}

#footer a:visited {
  color: #bfbfbf;
  text-decoration: underline;
}
</style>

</head>

<body>
<div>
  <h3>Processes execution timeline</h3>
  <p>
    Launch time: <span id='label_launch'> </span><br>
    Elapsed time: <span id='label_elapsed'> </span><br>
    Legend: job wall time / memory usage (RAM) <span id='label_legend'> </span>
  </p>
  <div id="timeline"></div>
</div>

<div id='footer'>
  Created with Nextflow -- <a href='http://www.nextflow.io' target='_blank'>http://nextflow.io</a>
</div>

    var data = window.data.processes;
    var beginningMillis = window.data.beginningMillis;
    var endingMillis = window.data.endingMillis;
    var elapsed = window.data.elapsed;

    var handler=null;

    function getTickFormat() {
      var MIN = 1000 * 60
      var HOUR = MIN * 60
      var DAY = HOUR * 24
      var delta = (endingMillis - beginningMillis)

      if( delta < 2 * MIN ) {
        return {
          format: d3.time.format("%S"),
          tickTime: d3.time.seconds,
          tickInterval: 5,
          tickSize: 6
        }
      }

      if( delta < 2 * HOUR ) {
        return {
          format: d3.time.format("%M"),
          tickTime: d3.time.minutes,
          tickInterval: 5,
          tickSize: 6
        }
      }

      if( delta < 2 * DAY ) {
        return {
          format: d3.time.format("%H:%M"),
          tickTime: d3.time.hours,
          tickInterval: 1,
          tickSize: 6
        }
      }

      if( delta <= 7 * DAY ) {
        return {
          format: d3.time.format("%b %e %H:%M"),
          tickTime: d3.time.hours,
          tickInterval: 6,
          tickSize: 6
        }

        $('.labelSpan').remove();

        return (labelMargin * scale);
    }

      handler=null;
      $("#timeline").empty()
      $('#label_elapsed').text(elapsed)
      $('#label_launch').text( d3.time.format('%d %b %Y %H:%M')(new Date(beginningMillis)) )

      var chart = d3.timeline()
        .stack() // toggles graph stacking
        .margin({left:getLabelMargin(0.85), right:100, top:0, bottom:0})
        .tickFormat( getTickFormat() )
        .rowSeperators('#f5f5f5')
        .showTimeAxisTick()
        ;
      var svg = d3.select("#timeline").append("svg").attr("width", width).datum(data).call(chart);
    }
